pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TokenVesting is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;

    struct VestingSchedule {
        uint256 totalAmount;
        uint256 releasedAmount;
        uint256 startTime;
        uint256 duration;
        uint256 cliff;
    }

    IERC20 public token;
    mapping(address => VestingSchedule) public vestingSchedules;

    event VestingScheduleCreated(address beneficiary, uint256 totalAmount, uint256 startTime, uint256 duration, uint256 cliff);
    event TokensReleased(address beneficiary, uint256 amount);

    constructor(IERC20 _token) {
        token = _token;
    }

    function createVestingSchedule(
        address beneficiary,
        uint256 totalAmount,
        uint256 startTime,
        uint256 duration,
        uint256 cliff
    ) external onlyOwner {
        require(beneficiary != address(0), "TokenVesting: beneficiary is the zero address");
        require(totalAmount > 0, "TokenVesting: totalAmount is 0");
        require(duration > 0, "TokenVesting: duration is 0");
        require(cliff <= duration, "TokenVesting: cliff is longer than duration");

        vestingSchedules[beneficiary] = VestingSchedule({
            totalAmount: totalAmount,
            releasedAmount: 0,
            startTime: startTime,
            duration: duration,
            cliff: cliff
        });

        emit VestingScheduleCreated(beneficiary, totalAmount, startTime, duration, cliff);
    }

    function release(address beneficiary) external {
        VestingSchedule storage schedule = vestingSchedules[beneficiary];
        require(schedule.totalAmount > 0, "TokenVesting: no vesting schedule for beneficiary");

        uint256 unreleased = releasableAmount(schedule);
        require(unreleased > 0, "TokenVesting: no tokens are due");

        schedule.releasedAmount = schedule.releasedAmount.add(unreleased);
        token.safeTransfer(beneficiary, unreleased);

        emit TokensReleased(beneficiary, unreleased);
    }

    function releasableAmount(VestingSchedule memory schedule) internal view returns (uint256) {
        return vestedAmount(schedule).sub(schedule.releasedAmount);
    }

    function vestedAmount(VestingSchedule memory schedule) internal view returns (uint256) {
        if (block.timestamp < schedule.startTime.add(schedule.cliff)) {
            return 0;
        } else if (block.timestamp >= schedule.startTime.add(schedule.duration)) {
            return schedule.totalAmount;
        } else {
            uint256 timeElapsed = block.timestamp.sub(schedule.startTime);
            return schedule.totalAmount.mul(timeElapsed).div(schedule.duration);
        }
    }
}
